import{_ as r,a,H as o,S as i,D as s,o as n}from"./chunks/framework.DX1C7ho2.js";const g=JSON.parse('{"title":"Monthly Updates [July]","description":"July 2024 updates.","frontmatter":{"title":"Monthly Updates [July]","description":"July 2024 updates.","date":"2024-07-01T00:00:00.000Z","next":false,"aside":"right","prev":false,"footer":true},"headers":[],"relativePath":"posts/july-2024.md","filePath":"posts/july-2024.md"}'),l={name:"posts/july-2024.md"};function d(h,e,p,f,u,m){const t=s("Post");return n(),a("div",null,[o(t,{authors:"nbats"}),e[0]||(e[0]=i('<div class="info custom-block"><p class="custom-block-title">INFO</p><p>These update threads only contains major updates. If you&#39;re interested in seeing all minor changes you can follow our <a href="https://github.com/Lost Pages/Lost Pagesedit/commits/main" target="_blank" rel="noreferrer">Commits Page</a> on GitHub or <a href="https://redd.it/17f8msf" target="_blank" rel="noreferrer">Updates Channel</a> in Discord.</p></div><h2 id="tournament-results" tabindex="-1">Tournament Results <a class="header-anchor" href="#tournament-results" aria-label="Permalink to &quot;Tournament Results&quot;">​</a></h2><p>We did another streaming sites tournament to help us better re-order and clean up the section. When we did this publicly the first time there was obvious cheating, so we decided to make this more private, and allowed only members with discord roles to vote. During each round we also had discussions about the sites which can be viewed in our discord polls channel. These discussions were taken into account when reordering, but for the most part we relied on the voting results.</p><p>In the end some sites managed to keep their previous spots, a few have been starred, unstarred, or even removed if they were low quality / broken. If you see a round with no votes either way, it means one of the sites was DQ&#39;d.</p><h2 id="final-results-before-vs-after" tabindex="-1"><a href="https://challonge.com/Multi_Host_Streaming.svg" target="_blank" rel="noreferrer">Final Results</a> / <a href="https://i.imgur.com/MXN0mR5.png" target="_blank" rel="noreferrer">Before vs. After</a> <a class="header-anchor" href="#final-results-before-vs-after" aria-label="Permalink to &quot;[Final Results](https://challonge.com/Multi_Host_Streaming.svg) / [Before vs. After](https://i.imgur.com/MXN0mR5.png)&quot;">​</a></h2><p>We&#39;ll be doing more tournaments in the future, so make sure to join our discord if you want to be a part of them, and let us know which sections you&#39;d like to see most.</p><hr><h3 id="wiki-updates" tabindex="-1">Wiki Updates <a class="header-anchor" href="#wiki-updates" aria-label="Permalink to &quot;Wiki Updates&quot;">​</a></h3><ul><li><p>Added <a href="https://lostpages.netlify.app/videopiracyguide#stremio-tools" target="_blank" rel="noreferrer">Stremio Tools</a> section to Streaming.</p></li><li><p>Added <a href="https://lostpages.netlify.app/ai#video-generation" target="_blank" rel="noreferrer">Video Generation</a> section to AI.</p></li><li><p>Added <a href="https://lostpages.netlify.app/text-tools#audio-transcription" target="_blank" rel="noreferrer">Audio Transcription</a> section to Text Tools.</p></li><li><p>Added <a href="https://lostpages.netlify.app/system-tools#system-audio" target="_blank" rel="noreferrer">System Audio</a> and <a href="https://lostpages.netlify.app/system-tools#usb-bootloaders" target="_blank" rel="noreferrer">USB / Bootloaders</a> sections to System Tools.</p></li><li><p>Added <a href="https://lostpages.netlify.app/adblockvpnguide#network-security" target="_blank" rel="noreferrer">Network Security</a> section to Privacy.</p></li><li><p>Added <a href="https://lostpages.netlify.app/readingpiracyguide#fanfiction-stories" target="_blank" rel="noreferrer">Fanfiction / Stories</a> section to Reading.</p></li><li><p>Added <a href="https://lostpages.netlify.app/audiopiracyguide#audio-metadata" target="_blank" rel="noreferrer">Audio Metadata</a> section to Audio.</p></li><li><p>Added <a href="https://lostpages.netlify.app/linuxguide#wayland-compositors" target="_blank" rel="noreferrer">Wayland Compositors</a> section to Linux.</p></li><li><p>Added <a href="https://lostpages.netlify.app/storage#latex-tools" target="_blank" rel="noreferrer">Latex Tools</a> section to Math.</p></li><li><p>Turned <a href="https://lostpages.netlify.app/internet-tools#email-tools" target="_blank" rel="noreferrer">Email Tools</a> into a main section with subsections.</p></li><li><p>Split Subtitle section into <a href="https://lostpages.netlify.app/videopiracyguide#subtitles" target="_blank" rel="noreferrer">Tools</a> and <a href="https://lostpages.netlify.app/videopiracyguide#download-subtitles" target="_blank" rel="noreferrer">Downloads</a>.</p></li><li><p>Added multiple (15) new sections to <a href="https://Lost Pages.pages.dev/devtools" target="_blank" rel="noreferrer">Dev Tools</a>, and cleaned up a lot of old sections.</p></li><li><p>Cleaned up <a href="https://Lost Pages.pages.dev/video-tools#video-file-hosts" target="_blank" rel="noreferrer">Video Hosts</a>, <a href="https://lostpages.netlify.app/img-tools#image-optimization" target="_blank" rel="noreferrer">Image Optimization</a> and <a href="https://lostpages.netlify.app/img-tools#icons-avatars" target="_blank" rel="noreferrer">Icons / Avatars</a> sections.</p></li><li><p>Started adding Non-English spellings (i.e. Chinese / 汉语方言) to titles in the <a href="https://Lost Pages.pages.dev/non-english" target="_blank" rel="noreferrer">Non-Eng section</a>. We haven&#39;t been able to translate all the sections yet, so if you can help fill in the blanks please send your translations in the comments.</p></li></ul><hr><h3 id="stars-added-⭐" tabindex="-1">Stars Added ⭐ <a class="header-anchor" href="#stars-added-⭐" aria-label="Permalink to &quot;Stars Added ⭐&quot;">​</a></h3><ul><li><p>Starred <a href="https://lostpages.netlify.app/file-tools#file-hosts" target="_blank" rel="noreferrer">Hidan</a> in File Hosts. Fast, unlimited size, no account required, publishes when they remove files.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/system-tools#custom-themes" target="_blank" rel="noreferrer">Catppuccin</a> in Custom Themes. High quality pastel system app themes.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/internet-tools#link-in-bio-sites" target="_blank" rel="noreferrer">Bio Link</a> in Link in Bio Sites. Feature-rich, nice UI, stood out to us when going through the section.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/gamingpiracyguide#emulators" target="_blank" rel="noreferrer">RetroAchievements</a> in Emulators. Add achievements to retro games / ROMs.</p></li><li><p>Starred <a href="https://www.reddit.com/r/translator/" target="_blank" rel="noreferrer">/r/Translator</a> in Translators. Allows you to request translations of almost anything.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/ai#online-chatbots" target="_blank" rel="noreferrer">sdk.vercel</a> in Online Chatbots. Chatbot playground with unlimited GPT-4o.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/android-iosguide#foss-apks" target="_blank" rel="noreferrer">FossifyOrg</a> in FOSS APKs. Covers most basic apps, minimal UI.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/android-iosguide#optimization" target="_blank" rel="noreferrer">Universal Android Debloater</a> in Android Optimization. Updated fork of original UAD.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/android-iosguide#android-privacy" target="_blank" rel="noreferrer">Amarok</a> in Android Privacy. Easily hide private files / apps on android.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/android-iosguide#ios-apps" target="_blank" rel="noreferrer">Sideloadly</a> in iOS Apps. Lightweight, simple setup, auto-updates apps.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/android-iosguide#ios-audio" target="_blank" rel="noreferrer">EeveeSpotify</a> in iOS Audio. Updated Spotify premium app now that spotilife has stopped working.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/android-iosguide#smart-tv-firestick" target="_blank" rel="noreferrer">S0undTV</a> in Firestick. Ad-free Twitch for Firestick.</p></li><li><p>Starred <a href="https://lostpages.netlify.app/miscguide#random" target="_blank" rel="noreferrer">Uncyclopedia</a> in Fun Sites.</p></li><li><p>Added star back to <a href="https://lostpages.netlify.app/gaming-tools#roblox-tools" target="_blank" rel="noreferrer">Bloxstrap</a>. Most issues are being fixed and repo seems to be active again.</p></li></ul><hr><h3 id="things-removed" tabindex="-1">Things Removed <a class="header-anchor" href="#things-removed" aria-label="Permalink to &quot;Things Removed&quot;">​</a></h3><ul><li><p>Unstarred Vimms, they thought it was trolls at first, but now <a href="https://i.ibb.co/Dp9Kwk4/image.png" target="_blank" rel="noreferrer">Lego and Sega</a> have both joined to take down games.</p></li><li><p>Unstarred XDM + Motrix, neither is updated as often as other big DL managers and XDM gives people issues on mobile.</p></li><li><p>Unstarred SKLauncher, its closed-source, cant download with adblock enabled, and we have better MC launchers listed anyways.</p></li></ul>',15))])}const b=r(l,[["render",d]]);export{g as __pageData,b as default};
